import XCTest

#if os(OSX) || os(iOS)

import GeoFeatures
@testable import GeoFeaturesPlaygroundSupport

class CartesianGeometryVisualizationViewTests: XCTestCase {

    var context: CGContext? = nil

    override func setUp() {
        context = CGContext(data: nil, width: 200, height: 200, bitsPerComponent: 8, bytesPerRow: 0, space: CGColorSpaceCreateDeviceRGB(), bitmapInfo: CGImageAlphaInfo.premultipliedLast.rawValue)

        XCTAssertNotNil(context, "Could not create graphics context for tests.")
    }

    func testArchive() {
        let input = Polygon([[[1, 1], [64, 128], [128, 1], [1, 1]], [[32, 20], [96, 20], [64, 86], [32, 20]]])

        let view = CartesianGeometryVisualizationView(geometry: input)

        let archive = NSKeyedArchiver.archivedData(withRootObject: view)

        guard NSKeyedUnarchiver.unarchiveObject(with: archive) is CartesianGeometryVisualizationView
            else {
                XCTFail("Failed to unarchive CartesianGeometryVisualizationView."); return
        }
    }

    func testDraw() {
        let input = Polygon([[[1, 1], [64, 128], [128, 1], [1, 1]], [[32, 20], [96, 20], [64, 86], [32, 20]]])

        let view = CartesianGeometryVisualizationView(geometry: input)

        view.draw(CGRect(x: 0, y: 0, width: 200, height: 200))
    }

    func testDrawWithContext() {
        let input = Polygon([[[1, 1], [64, 128], [128, 1], [1, 1]], [[32, 20], [96, 20], [64, 86], [32, 20]]])

        #if os(OSX)
            let expected = ""
        #elseif os(iOS)
            let expected = ""
        #endif

        let view = CartesianGeometryVisualizationView(geometry: input)

        view.draw(CGRect(x: 0, y: 0, width: 200, height: 200), context: self.context, blendMode: .overlay)

        guard let image = context?.makeImage(), let data = image.dataProvider?.data
            else { XCTFail("Failed to create image/data from context for test."); return }

        /// Note: to save a visual verification png file, set SAVE_VERIFICATION_IMAGE for the build.
        #if SAVE_VERIFICATION_IMAGE
            self.writeCGImage(image, to: "testDrawWithContext.png")
        #endif

        XCTAssertEqual((data as Data).base64EncodedString(), expected)
    }

    func testDrawOversizedPolygonWithContext() {
        let input = Polygon([[[1, 1], [164, 1128], [1128, 11], [1, 1]], [[32, 20], [196, 120], [164, 186], [32, 20]]])

        #if os(OSX)
            let expected = ""
        #elseif os(iOS)
            let expected = ""
        #endif

        let view = CartesianGeometryVisualizationView(geometry: input)

        view.draw(CGRect(x: 0, y: 0, width: 200, height: 200), context: self.context, blendMode: .overlay)

        guard let image = context?.makeImage(), let data = image.dataProvider?.data
            else { XCTFail("Failed to create image/data from context for test."); return }

        /// Note: to save a visual verification png file, set SAVE_VERIFICATION_IMAGE for the build.
        #if SAVE_VERIFICATION_IMAGE
        self.writeCGImage(image, to: "testDrawWithContext.png")
        #endif

        XCTAssertEqual((data as Data).base64EncodedString(), expected)
    }
}

extension CartesianGeometryVisualizationViewTests {

    @discardableResult
    private func writeCGImage(_ image: CGImage, to destinationPath: String) -> Bool {
        let url = URL(fileURLWithPath: destinationPath)

        guard let destination = CGImageDestinationCreateWithURL(url as CFURL, "public.png" as CFString, 1, nil)
            else { return false }

        print("Verification image written to: \(url.absoluteString)")

        CGImageDestinationAddImage(destination, image, nil)

        return CGImageDestinationFinalize(destination)
    }
}

#endif
